import React, { Component } from 'react'
import './app.css';
import Link from 'next/link'

class TodoItems extends Component {
  // createTasks(item) {
  //   return <li key={item.key} onClick={() => this.props.deleteItem(item.key)}>{item.text}</li>
  // }
  render(props) {
    const todoEntries = this.props.entries
    const listItems = todoEntries.map((item) => {
      return <li classname = "task" key={item.key} onClick={() => this.props.deleteItem(item.key)}>{item.text}</li>
    })

    return <ul className="theList">{listItems}
    <style jsx>{`
        p {
          color: blue;
        }
        div {
          background: red;
        }
        @media (max-width: 600px) {
          div {
            background: blue;
          }
        }
      `}</style>
      <style global jsx>{`
      font-family: 'Montserrat', sans-serif;
      background: #ecf0f1;
      `}</style>
    </ul>
  }
}

export default TodoItems
